import React, { Component } from 'react'
import {withRouter} from 'react-router-dom'
import { Button, Form, Upload, Input, Card, message } from 'antd'
import { PlusOutlined } from '@ant-design/icons';
import { connect } from 'react-redux';

class GICheck extends Component {
    render() {
        const title = 'Check Domestic Mobility Proxy Forms';
        const extra = (<Button type="primary" icon={<PlusOutlined />} onClick={()=>this.props.history.replace('/gi-submit')}>Add</Button>)
        return (
            <Card title={title} extra={extra}>
            </Card>
        )
    }
}

export default connect(
    state => ({}),
    {}
)(withRouter(GICheck))
